const Nav = (props) => {
    // props.nav = [{ title: 'Home' }, { title: 'About' }, { title: 'SignIn' }]
    let list = [
        <li>
            <a href="#">{props.nav[0].title}</a>
        </li>,
        <li>
            <a href="#">{props.nav[1].title}</a>
        </li>,
        <li>
            <a href="#">{props.nav[2].title}</a>
        </li>,
    ]

    return (
        <nav>
            <ul>{list}</ul>
        </nav>
    )
}

export default Nav
